import React, { Component } from "react";
import Library from "../image/design/WebDesignBooks.JPG";
import Html from "./image/design/html.png";
import Css from "./image/design/css.png";
import Js from "./image/design/javascript.png";
import SerStyle from "./Ser_style";

class Devlopment extends Component {
  render() {
    return (
      <div>
        <SerStyle />
        <div className="container">
          <div className="row">
            <div className="col-12" style={design}>
              <h2 style={color}>Web Development Roadmaps</h2>
              <h3 style={color} className="text-center">
                Front-End Roadmap
              </h3>
            </div>

            <div className="step-1 col-12">
              <div className="row">
                <h4 className="step-title text-center">STEP 1</h4>
                <h4 className="step-title text-center">Learn the Basics</h4>
                <div className="step-1-content col-11">
                  <ul>
                    <li>
                      Every Web Developer must have a basic understanding of
                      HTML, CSS, and JavaScript.
                    </li>
                    <li>
                      Responsive Web Design is used in all types of modern web
                      development.
                    </li>
                    <li>
                      ECMAScript 5 (JavaScript 5) is supported in all modern
                      browsers. Take a good look at it, especially the new array
                      functions.
                    </li>
                  </ul>
                </div>
                <div className="col-12 col-lg-4">

                </div>
                <div className="col-12 col-lg-4">
                  <img src={Library} alt="not found" className="w-100" />
                </div>
                <div className="col-12 col-lg-4">
                  <img src={Library} alt="not found" className="w-100" />
                </div>
              </div>
            </div>

          </div>
        </div>
      </div>
    );
  }
}
const design = {
  marginTop: "30px",
  padding: "0 15px",
};
const color = {
  color: "#fba62f",
};

export default Devlopment;
